import keras
from keras import Sequential
from keras.layers import Dense, Activation, Dropout, MaxPooling2D, Flatten, Conv2D, BatchNormalization, GlobalAveragePooling2D
import numpy as np
from tensorflow.keras.datasets import cifar10
from tensorflow.keras.utils import to_categorical

image_shape = (224,224,3)
np.random.seed(1000) #Instantiate an empty model
model = Sequential()

model.add(Conv2D(filters=32,kernel_size=(3,3),strides=(1,1),input_shape=image_shape,padding='same'))
model.add(BatchNormalization())
model.add(Activation('relu'))

model.add(MaxPooling2D(pool_size=(2,2),strides=(2,2),padding='valid'))

model.add(Conv2D(filters=64,kernel_size=(3,3),strides=(1,1),padding='same'))
model.add(BatchNormalization())
model.add(Activation('relu'))

model.add(MaxPooling2D(pool_size=(2,2),strides=(2,2),padding='valid'))

model.add(Conv2D(filters=128,kernel_size=(3,3),strides=(1,1),padding='same'))
model.add(BatchNormalization())
model.add(Activation('relu'))

model.add(Conv2D(filters=64,kernel_size=(1,1),strides=(1,1),padding='same'))
model.add(BatchNormalization())
model.add(Activation('relu'))

model.add(Conv2D(filters=128,kernel_size=(3,3),strides=(1,1),padding='same'))
model.add(BatchNormalization())
model.add(Activation('relu'))

model.add(MaxPooling2D(pool_size=(2,2),strides=(2,2),padding='valid'))

model.add(Conv2D(filters=256,kernel_size=(3,3),strides=(1,1),padding='same'))
model.add(BatchNormalization())
model.add(Activation('relu'))

model.add(Conv2D(filters=128,kernel_size=(1,1),strides=(1,1),padding='same'))
model.add(BatchNormalization())
model.add(Activation('relu'))

model.add(Conv2D(filters=256,kernel_size=(3,3),strides=(1,1),padding='same'))
model.add(BatchNormalization())
model.add(Activation('relu'))

model.add(MaxPooling2D(pool_size=(2,2),strides=(2,2),padding='valid'))

model.add(Conv2D(filters=512,kernel_size=(3,3),strides=(1,1),padding='same'))
model.add(BatchNormalization())
model.add(Activation('relu'))

model.add(Conv2D(filters=256,kernel_size=(1,1),strides=(1,1),padding='same'))
model.add(BatchNormalization())
model.add(Activation('relu'))

model.add(Conv2D(filters=512,kernel_size=(3,3),strides=(1,1),padding='same'))
model.add(BatchNormalization())
model.add(Activation('relu'))

model.add(Conv2D(filters=256,kernel_size=(1,1),strides=(1,1),padding='same'))
model.add(BatchNormalization())
model.add(Activation('relu'))

model.add(Conv2D(filters=512,kernel_size=(3,3),strides=(1,1),padding='same'))
model.add(BatchNormalization())
model.add(Activation('relu'))

model.add(MaxPooling2D(pool_size=(2,2),strides=(2,2),padding='valid'))

model.add(Conv2D(filters=1024,kernel_size=(3,3),strides=(1,1),padding='same'))
model.add(BatchNormalization())
model.add(Activation('relu'))

model.add(Conv2D(filters=512,kernel_size=(1,1),strides=(1,1),padding='same'))
model.add(BatchNormalization())
model.add(Activation('relu'))

model.add(Conv2D(filters=1024,kernel_size=(3,3),strides=(1,1),padding='same'))
model.add(BatchNormalization())
model.add(Activation('relu'))

model.add(Conv2D(filters=512,kernel_size=(1,1),strides=(1,1),padding='same'))
model.add(BatchNormalization())
model.add(Activation('relu'))

model.add(Conv2D(filters=1024,kernel_size=(3,3),strides=(1,1),padding='same'))
model.add(BatchNormalization())
model.add(Activation('relu'))

model.add(Conv2D(filters=1000,kernel_size=(1,1),strides=(1,1),padding='same'))
model.add(BatchNormalization())
model.add(Activation('relu'))

model.add(GlobalAveragePooling2D())

model.add(Flatten())

model.add(Dense(1000))
model.add(Activation('softmax'))

model.summary()

#Compile the model
model.compile(loss=keras.losses.categorical_crossentropy,optimizer='adam',metrics=['accuracy'])